function y({total:e=9,hCenter:o=Math.random()*360,hCycles:p=1,sRange:n=[.4,.35],sEasing:c=r=>Math.pow(r,2),lRange:t=[Math.random()*.1,.9],lEasing:b=r=>Math.pow(r,1.5)}={}){let r=360/e,m=new Array(e).fill(0).map((i,u)=>360+(-180+o+u*p*r)%360),a=t[1]-t[0],s=n[1]-n[0],f=[m.pop()||0,n[0],t[0]],h=new Array(e-1).fill(0).map((i,u)=>[m.pop()||0,n[0]+s*c((u+1)/(e-1)),t[0]+a*b((u+1)/(e-1))]);return[f,...h]}export{y as default};
